INSERT INTO `guidance_stud_eval` (`id`, `stud_id`, `name`, `type`, `profile`, `meaning`, `percentage`, `description`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(38, 120324522, 'Kenneth  Jorquia', 'INFP', 'The Idealist', 'Introversion,iNtuition,Feeling,Perceiving', 'You belong to 4-5% population', 'INFPs, like most introverts, are quiet and reserved. They prefer not to talk about themselves, especially in the first encounter with a new person. They like spending time alone in quiet places where they can make sense of what is happening around them. They love analyzing signs and symbols, and consider them to be metaphors that have deeper meanings related to life. They are lost in their imagination and daydreams, always drowned in the depth of their thoughts, fantasies, and ideas.', '', '', '', '', '', '', '', ''),
(39, 19014021, 'Patrick  Andaya', 'INTJ', 'The Mastermind', 'Introversion,iNtuition,Thinking,Judging', 'You belong to 2-4% population', 'INTJs, as introverts, are quiet, reserved, and comfortable being alone. They are usually self-sufficient and would rather work alone than in a group. Socializing drains an introvert’s energy, causing them to need to recharge. INTJs are interested in ideas and theories. When observing the world they are always questioning why things happen the way they do. They excel at developing plans and strategies, and don’t like uncertainty.', '', '', '', '', '', '', '', ''),
(40, 120, 'dsfk  slkf', 'ENFP', 'The Champion', 'Extraversion,iNtuition,Feeling,Perceiving', 'You belong to 6-8% population', 'ENFPs have an Extraverted, Intuitive, Feeling and Perceiving personality. This personality type is highly individualistic and Champions strive toward creating their own methods, looks, actions, habits, and ideas and hate when they are forced to live inside a box. They like to be around other people and have a strong intuitive nature when it comes to themselves and others. They operate from their feelings most of the time, and they are highly perceptive and thoughtful.', 'Extraversion', 'Extraversion includes traits such as talkative, energetic, assertive, and outgoing. Social interaction is the key here. Extraverts often take on positions of leadership; first to offer their opinion and suggestions. They are often quick to approach others, especially on the dating scene.', 'Intuituion', 'Paying the most attention to impressions or the meaning and patterns of the information I get. I would rather learn by thinking a problem through than by hands-on experience. I\'m interested in new things and what might be possible, so that I think more about the future than the past.', 'Feeling', 'People with the feeling trait, or feelers, are typically aware of not only their own emotions but the emotions of others around them, too. They are protective of those they value, which affects endeavors they conduct both personally and professionally.', 'Perceiving', 'Perceivers approach life and a freewheeling, spontaneous way, preferring to keep their options open than make a clear plan of action. They perceive structure as limiting and seek flexibility in their lives. They like adapting to new situations and feel frustrated by the daily grind of routines.'),
(41, 142365, 'Hannah  Jane', 'ESFJ', 'The Provider ', 'Extraversion,Sensing,Feeling,Judging', 'You belong to 9-13% population', 'ESFJs are the stereotypical extroverts. They are social butterflies, and their need to interact with others and make people happy usually ends up making them popular. The ESFJ usually tends to be the cheerleader or sports hero in high school and college. Later on in life, they continue to revel in the spotlight, and are primarily focused on organizing social events for their families, friends and communities. ESFJ is a common personality type and one that is liked by many people.', 'Extraversion', 'Extraversion includes traits such as talkative, energetic, assertive, and outgoing. Social interaction is the key here. Extraverts often take on positions of leadership; first to offer their opinion and suggestions. \r\nThey are often quick to approach others, especially on the dating scene.', 'Sensing', 'Paying attention to physical reality, what I see, hear, touch, taste, and smell. I\'m concerned with what is actual, present, current, and real. I notice facts and I remember details that are important to me. \r\nI like to see the practical use of things and learn best when I see how to use what I\'m learning.', 'Feeling', 'People with the feeling trait, or feelers, are typically aware of not only their own emotions but the emotions of others around them, too. \r\nThey are protective of those they value, which affects endeavors they conduct both personally and professionally.', 'Judging', 'Judging means you seek closure from the outer world through order, planning, and organization. When possible, you prefer for things to be settled and crossed off your list. Judgers may want to find work that allows them to set goals, be organized, and make decisions.'),
(42, 19012606, 'Ivan  Pogi', 'INTP', 'The Thinker', 'Introversion,iNtuition,Thinking,Perceiving', 'You belong to 3-5% population', 'INTPs are well known for their brilliant theories and unrelenting logic, which makes sense since they are arguably the most logical minded of all the personality types. They love patterns, have a keen eye for picking up on discrepancies, and a good ability to read people, making it a bad idea to lie to an INTP. People of this personality type aren’t interested in practical, day-to-day activities and maintenance.', 'Introversion', 'An introvert is a person with qualities of a personality type known as introversion, which means that they feel more comfortable focusing on their inner thoughts and ideas, rather than what\'s happening externally. They enjoy spending time with just one or two people, rather than large groups or crowds.', 'Intuition', 'Paying the most attention to impressions or the meaning and patterns of the information I get. I would rather learn by thinking a problem through than by hands-on experience. I\'m interested in new things and what might be possible, so that I think more about the future than the past.', 'Thinking', 'People with the thinking trait, or thinkers, heavily rely on objective information in all areas of their life. \r\nThey are critical thinkers who evaluate situations and people based on logic and facts and focus on problem-solving when confronted with personal or work challenges.', 'Perceiving', 'Perceivers approach life and a freewheeling, spontaneous way, preferring to keep their options open than make a clear plan of action. They perceive structure as limiting and seek flexibility in their lives. They like adapting to new situations and feel frustrated by the daily grind of routines.');

