INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(1, 'ISTJ', 'ISTJs are intimidating. They appear serious, formal, and proper. They also love traditions and old-school values that uphold patience, hard work, honor, and social and cultural responsibility. They are reserved, calm, quiet, and upright.', 'Introversion,Sensing,Thinking,Judging', '11-14%', 'The Inspector', , 'Due to their natural strengths ISTJs often find themselves in occupations that involve effective control of production process, good understanding of details, clear-cut planning, require responsibility and being an efficient worker. They are found across a wide range of industries and verticals, in organizations of all sizes. ISTJs succeed as military and police workers, engineers, auditors, lawyers, surgeons. They are found in technology companies among those who deal with practical aspects of technology (e.g. implementation specialists). ISTJs make good project managers, mid-rank managers, department heads.', 'ISTJs come across in communication as open and natural, as well as precise and to-the-point, but they can also be somewhat formal. They are great sticklers for the rules and communication norms of their social milieu.\r\n\r\nISTJs occasionally find it hard to discuss the finer feelings of the soul: topics of love, and lyric poetry may not evoke a strong emotional reaction from them.\r\nISTJs come across in communication as open and natural, as well as precise and to-the-point, but they can also be somewhat formal. They are great sticklers for the rules and communication norms of their social milieu.\r\n\r\nISTJs occasionally find it hard to discuss the finer feelings of the soul: topics of love, and lyric poetry may not evoke a strong emotional reaction from them.\r\n', 'Introversion', 'An introvert is a person with qualities of a personality type known as introversion, which means that they feel more comfortable focusing on their inner thoughts and ideas, rather than what\'s happening externally. They enjoy spending time with just one or two people, rather than large groups or crowds.', 'Sensing', 'Paying attention to physical reality, what I see, hear, touch, taste, and smell. I\'m concerned with what is actual, present, current, and real. I notice facts and I remember details that are important to me. \r\nI like to see the practical use of things and learn best when I see how to use what I\'m learning.', 'Thinking', 'People with the thinking trait, or thinkers, heavily rely on objective information in all areas of their life. \r\nThey are critical thinkers who evaluate situations and people based on logic and facts and focus on problem-solving when confronted with personal or work challenges.', 'Judging', 'Judging means you seek closure from the outer world through order, planning, and organization. \r\nWhen possible, you prefer for things to be settled and crossed off your list. Judgers may want to find work that allows them to set goals, be organized, and make decisions.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(2, 'ISFJ', 'ISFJs are philanthropists and they are always ready to give back and return generosity with even more generosity. ISFJs are warm and kind-hearted. They value harmony and cooperation, and are likely to be very sensitive to other people’s feelings. People value the ISFJ personality type for their consideration and awareness, and their ability to bring out the best in others.', 'Introversion,Sensing,Feeling,Judging', '9-14%', 'The Nurturer', , 'ISFJs often find themselves in occupations that either involve a lot of interactions with other people and/or require meticulousness and diligence. They work in organizations of various sizes and industries, where as a rule they work with people. Very often ISFJs realize their potential in health care (nurses, patient care and medical services, as well as administrative jobs) and various community care organizations. Other favoured areas of occupation include social work and service-oriented professions.', 'As a rule, in communication ISFJs are friendly and supportive, as well as practical and to the point. They are ready to come to the aid. At the same time, they might feel unhappy if their help is disregarded. They strive to build consensus among those involved in the conversation. During communication, it is important for ISFJs to sense that they are with a group of friends, co-workers, or like-minded individuals that share their interests and opinions. They are obvious proponents of minding manners and rules of communication accepted in their circle or community. As a rule, ISFJs stand firmly behind their values.', 'Introversion', 'An introvert is a person with qualities of a personality type known as introversion, which means that they feel more comfortable focusing on their inner thoughts and ideas, rather than what\'s happening externally. They enjoy spending time with just one or two people, rather than large groups or crowds.', 'Sensing', 'Paying attention to physical reality, what I see, hear, touch, taste, and smell. I\'m concerned with what is actual, present, current, and real. I notice facts and I remember details that are important to me. I like to see the practical use of things and learn best when I see how to use what I\'m learning.', 'Feeling', 'People with the feeling trait, or feelers, are typically aware of not only their own emotions but the emotions of others around them, too. They are protective of those they value, which affects endeavors they conduct both personally and professionally.', 'Judging', 'Judging means you seek closure from the outer world through order, planning, and organization. When possible, you prefer for things to be settled and crossed off your list. Judgers may want to find work that allows them to set goals, be organized, and make decisions.\r\n');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(3, 'INFJ', 'INFJs are visionaries and idealists who ooze creative imagination and brilliant ideas. They have a different, and usually more profound, way of looking at the world. They have a substance and depth in the way they think, never taking anything at surface level or accepting things the way they are. Others may sometimes perceive people with the INFJ personality type as weird or amusing because of their different outlook on life.', 'Introversion,iNtuition,Feeling,Judging', '1-3%', 'The Counselor', , '\r\nINFJs are effective in occupations involving substantial intellectual work, caring for other people, and requiring creativity. INFJs build successful careers in a broad range of organizations. Social and community care services, counseling, teachers of humanities and social sciences, healthcare workers (both in administration and in medical services), various service-oriented professions as well as religious services and social movements are just some of the examples of occupations favourable to INFJs. Quite often they are found in mid-rank management positions. For some of them occupations in sciences or academia are also favourable.', 'To help others wherever possible, and even when it seems impossible, is what fills an INFJ’s life with meaning and serves as their main motivation. This is their main orientation in the world, and it defines how they relate to events and to people around them.\r\n\r\nIn communication INFJs come across as thoughtful, supportive, and caring. Communication with an INFJ is pleasant and easy, since they are inherently well-disposed towards the other party. They are attentive and empathetic to other people\'s feelings. Whenever one communicates with an INFJ, he or she instantly feels just how much they care about the people they know.', 'Introversion', 'An introvert is a person with qualities of a personality type known as introversion, which means that they feel more comfortable focusing on their inner thoughts and ideas, rather than what\'s happening externally. They enjoy spending time with just one or two people, rather than large groups or crowds.', 'Intuition', 'Paying the most attention to impressions or the meaning and patterns of the information I get. I would rather learn by thinking a problem through than by hands-on experience. I\'m interested in new things and what might be possible, so that I think more about the future than the past.', 'Feeling', 'People with the feeling trait, or feelers, are typically aware of not only their own emotions but the emotions of others around them, too. They are protective of those they value, which affects endeavors they conduct both personally and professionally.', 'Judging', 'Judging means you seek closure from the outer world through order, planning, and organization. When possible, you prefer for things to be settled and crossed off your list. Judgers may want to find work that allows them to set goals, be organized, and make decisions.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(4, 'INTJ', 'INTJs, as introverts, are quiet, reserved, and comfortable being alone. They are usually self-sufficient and would rather work alone than in a group. Socializing drains an introvert’s energy, causing them to need to recharge. INTJs are interested in ideas and theories. When observing the world they are always questioning why things happen the way they do. They excel at developing plans and strategies, and don’t like uncertainty.', 'Introversion,iNtuition,Thinking,Judging', '2-4%', 'The Mastermind', , 'Generally, INTJs have successful careers in areas requiring intensive intellectual efforts, presenting intellectual challenge, and creative approach. Due to the characteristics mentioned above, successful INTJs are found in technological companies, particularly in research and development, and also found among corporate lawyers, high- and mid-rank managers in technology companies and financial institutions.', 'INTJs try to figure out how the world around them is structured and what can be changed in it. They feel the best when they have figured something out and know how to improve it.\r\n\r\nINTJs are comfortable carrying out a conversation. They are neither arrogant nor are they formal, but might refrain from becoming quick acquaintances. They can come up against difficulties in situations requiring finer soft skills when communicating, such as being very tactful or particularly patient. On the whole, INTJs respect the established rules of communications although at times they may see them as a formality or a relic of tradition.', 'Introversion', 'An introvert is a person with qualities of a personality type known as introversion, which means that they feel more comfortable focusing on their inner thoughts and ideas, rather than what\'s happening externally. They enjoy spending time with just one or two people, rather than large groups or crowds.', 'Intuition', 'Paying the most attention to impressions or the meaning and patterns of the information I get. I would rather learn by thinking a problem through than by hands-on experience. I\'m interested in new things and what might be possible, so that I think more about the future than the past.', 'Thinking', 'People with the thinking trait, or thinkers, heavily rely on objective information in all areas of their life. \r\nThey are critical thinkers who evaluate situations and people based on logic and facts and focus on problem-solving when confronted with personal or work challenges.', 'Judging', 'Judging means you seek closure from the outer world through order, planning, and organization. When possible, you prefer for things to be settled and crossed off your list. Judgers may want to find work that allows them to set goals, be organized, and make decisions.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(5, 'ISTP', 'ISTPs are mysterious people who are usually very rational and logical, but also quite spontaneous and enthusiastic. Their personality traits are less easily recognizable than those of other types, and even people who know them well can’t always anticipate their reactions. Deep down, ISTPs are spontaneous, unpredictable individuals, but they hide those traits from the outside world, often very successfully.', 'Introversion,Sensing,Thinking,Perceiving', '4-6%', 'The Craftsman', , 'Due to their natural strengths ISTPs often find themselves in occupations that involve direct participation in manufacturing, production or maintenance process and good understanding of details. ISTPs succeed as technicians, mechanics, electricians, mechanical, electrical and other maintenance and repair specialists, trouble-shooters, handymen, drivers, programmers, athletes. They are good in rescue operations and in any occupations that are action-oriented and require specialized skills as well as analytical thinking.', 'ISTPs are open and straightforward in their communication. They tend to observe the rules and communication norms of their social milieu. However, they may have difficulty establishing a good relationship with people that they consider to be overly demanding.\r\n\r\nISTPs feel ill at ease in situations requiring finer people skills e.g. particular tactfulness and consideration. Some people may be offended by the ISTPs\' direct manner of expressing their opinions.\r\n\r\nISTPs often find it hard to express themselves when it comes to finer feelings. So, for instance, the discussion of love, lyric poetry or subtleties of emotional experiences may not evoke a strong reaction from them.', 'Introversion', 'An introvert is a person with qualities of a personality type known as introversion, which means that they feel more comfortable focusing on their inner thoughts and ideas, rather than what\'s happening externally. They enjoy spending time with just one or two people, rather than large groups or crowds.', 'Sensing', 'Paying attention to physical reality, what I see, hear, touch, taste, and smell. I\'m concerned with what is actual, present, current, and real. I notice facts and I remember details that are important to me. I like to see the practical use of things and learn best when I see how to use what I\'m learning.', 'Thinking', 'People with the thinking trait, or thinkers, heavily rely on objective information in all areas of their life. \r\nThey are critical thinkers who evaluate situations and people based on logic and facts and focus on problem-solving when confronted with personal or work challenges.', 'Perceiving', 'Perceivers approach life and a freewheeling, spontaneous way, preferring to keep their options open than make a clear plan of action. They perceive structure as limiting and seek flexibility in their lives. They like adapting to new situations and feel frustrated by the daily grind of routines.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(6, 'ISFP', 'ISFPs are introverts that do not seem like introverts. It is because even if they have difficulties connecting to other people at first, they become warm, approachable, and friendly eventually. They are fun to be with and very spontaneous, which makes them the perfect friend to tag along in whatever activity, regardless if planned or unplanned. ISFPs want to live their life to the fullest and embrace the present.', 'Introversion,Sensing,Feeling,Perceiving', '5-9%', 'The Composer', , 'ISFPs often find themselves in occupations that involve communications with customers and/or requiring a good sense of aesthetics, for example, in customer support roles, store sales associate roles (where it is not required to sell aggressively). Child care is also a favourable to ISFPs area. Working with data and spreadsheets is also suitable. ISFPs are able to realize their aesthetic abilities in arts, design and creative media companies.', 'Feelings and impressions are what ISFPs live by, and what fills their lives. Their world is full of feelings.\r\n\r\nISFPs take the pains and concerns of other people as their own. During communication, their attention is directed toward all the different shades of emotions. ISFPs are ready to provide emotional support and help to their conversation party. They are especially good at creating a climate of good-natured communication among those participating in the conversation.\r\n\r\nTopics that heavily rely on theoretical and logical reasoning, such as very scientific and technical ones do not particularly pique the interest of ISFPs.', 'Introversion', 'An introvert is a person with qualities of a personality type known as introversion, which means that they feel more comfortable focusing on their inner thoughts and ideas, rather than what\'s happening externally. They enjoy spending time with just one or two people, rather than large groups or crowds.', 'Sensing', 'Paying attention to physical reality, what I see, hear, touch, taste, and smell. I\'m concerned with what is actual, present, current, and real. I notice facts and I remember details that are important to me. \r\nI like to see the practical use of things and learn best when I see how to use what I\'m learning.', 'Feeling', 'People with the thinking trait, or thinkers, heavily rely on objective information in all areas of their life. \r\nThey are critical thinkers who evaluate situations and people based on logic and facts and focus on problem-solving when confronted with personal or work challenges.', 'Perceiving', 'Perceivers approach life and a freewheeling, spontaneous way, preferring to keep their options open than make a clear plan of action. They perceive structure as limiting and seek flexibility in their lives. They like adapting to new situations and feel frustrated by the daily grind of routines.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(7, 'INFP', 'INFPs, like most introverts, are quiet and reserved. They prefer not to talk about themselves, especially in the first encounter with a new person. They like spending time alone in quiet places where they can make sense of what is happening around them. They love analyzing signs and symbols, and consider them to be metaphors that have deeper meanings related to life. They are lost in their imagination and daydreams, always drowned in the depth of their thoughts, fantasies, and ideas.', 'Introversion,iNtuition,Feeling,Perceiving', '4-5%', 'The Idealist', , 'Overall, INFPs are effective in occupations involving a lot of intellectual work that is focused on humanities and social science, spirit and soul, inspirational activities, and requiring creativity. Social workers, psychologists, life coaches, addiction rehab counselors, mental and community care staff, children education, teaching, and also creative script writing are just some of the examples of suitable occupations for INFPs. They also succeed at academia thanks to their intellectual strength.', 'An INFP\'s perception of the world is defined by such notions as just/unjust and right/wrong. They feel best when they do what they believe to be right and just.\r\n\r\nFew can rival an INFP in their ability to deeply empathize with the other party\'s emotions and the struggle in their lives. They are capable of seeing deep into the other party\'s motives and sensing what the other party is concerned about the most. INFPs are capable of inspiring people to develop their abilities and talents. They are capable of providing effective support to the other party so that the latter may better understand their spiritual side and the way they relate to others.\r\n\r\nINFPs can be emotional in their communication with other people, although they always treat everyone with respect.', 'Introversion', 'An introvert is a person with qualities of a personality type known as introversion, which means that they feel more comfortable focusing on their inner thoughts and ideas, rather than what\'s happening externally. They enjoy spending time with just one or two people, rather than large groups or crowds.', 'Intuition', 'Paying the most attention to impressions or the meaning and patterns of the information I get. I would rather learn by thinking a problem through than by hands-on experience. I\'m interested in new things and what might be possible, so that I think more about the future than the past.', 'Feeling', 'People with the feeling trait, or feelers, are typically aware of not only their own emotions but the emotions of others around them, too. \r\nThey are protective of those they value, which affects endeavors they conduct both personally and professionally.', 'Perceiving', 'Perceivers approach life and a freewheeling, spontaneous way, preferring to keep their options open than make a clear plan of action. They perceive structure as limiting and seek flexibility in their lives. They like adapting to new situations and feel frustrated by the daily grind of routines.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(8, 'INTP', 'INTPs are well known for their brilliant theories and unrelenting logic, which makes sense since they are arguably the most logical minded of all the personality types. They love patterns, have a keen eye for picking up on discrepancies, and a good ability to read people, making it a bad idea to lie to an INTP. People of this personality type aren’t interested in practical, day-to-day activities and maintenance.', 'Introversion,iNtuition,Thinking,Perceiving', '3-5%', 'The Thinker', , 'Generally, INTPs build successful careers in areas requiring quite intensive intellectual efforts and calling for creative approach. INTPs are often found in research, development and analytical departments. INTPs often make a very successful career in academia thanks to their strong and versatile way of thinking and originality.', 'INTPs try to categorize everything around them and to validate the logical rigor of these categorizations. They feel the best when their categorizations turn out not only to be logically correct, but are also confirmed in real life.\r\n\r\nWhen communicating, INTPs come across as respectful, well thought out, and to the point, but at times may appear a bit remote. They may appear lacking warmness and cordiality. But, with people of equal intelligence they may enter into discussions or debates. INTPs often distance themselves from superficial acquaintanceship and keep to a social circle of colleagues and like-minded individuals.', 'Introversion', 'An introvert is a person with qualities of a personality type known as introversion, which means that they feel more comfortable focusing on their inner thoughts and ideas, rather than what\'s happening externally. They enjoy spending time with just one or two people, rather than large groups or crowds.', 'Intuition', 'Paying the most attention to impressions or the meaning and patterns of the information I get. I would rather learn by thinking a problem through than by hands-on experience. I\'m interested in new things and what might be possible, so that I think more about the future than the past.', 'Thinking', 'People with the thinking trait, or thinkers, heavily rely on objective information in all areas of their life. \r\nThey are critical thinkers who evaluate situations and people based on logic and facts and focus on problem-solving when confronted with personal or work challenges.', 'Perceiving', 'Perceivers approach life and a freewheeling, spontaneous way, preferring to keep their options open than make a clear plan of action. They perceive structure as limiting and seek flexibility in their lives. They like adapting to new situations and feel frustrated by the daily grind of routines.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(9, 'ESTP', 'ESTPs have an Extraverted, Sensing, Thinking, and Perceptive personality. ESTPs are governed by the need for social interaction, feelings and emotions, logical processes and reasoning, along with a need for freedom. Theory and abstracts don’t keep ESTP’s interested for long. ESTPs leap before they look, fixing their mistakes as they go, rather than sitting idle or preparing contingency plans.', 'Extraversion,iNtuition,Thinking,Perceiving', '4-5%', 'The Doer', , 'ESTPs often find themselves in occupations that require prompt and active response. ESTPs succeed as salespeople, crime and fraud investigators, sailors, racing drivers, athletes, actors, entrepreneurs, rescue operation staff, and sometimes politicians and special combat forces. Many ESTPs are found among implementation and maintenance specialists.', 'ESTPs are active communicators who know how to persuade and engage others with their speech. However, some people may be offended by their straightforwardness. The more variety ESTPs have in their communication, the more energetic they are and the greater their sense of fulfillment in life. ESTPs find it easy to communicate with various personality types, although they tend to be more superficial with some of them. ESTPs sometimes find it hard to express finer feelings; such topics as love, lyric poetry, and any subtleties of emotional experience may not evoke a strong emotional response in them.', 'Extraversion', 'Extraversion includes traits such as talkative, energetic, assertive, and outgoing. Social interaction is the key here. Extraverts often take on positions of leadership; first to offer their opinion and suggestions. \r\nThey are often quick to approach others, especially on the dating scene.', 'Sensing', 'Paying attention to physical reality, what I see, hear, touch, taste, and smell. I\'m concerned with what is actual, present, current, and real. I notice facts and I remember details that are important to me. \r\nI like to see the practical use of things and learn best when I see how to use what I\'m learning.', 'Thinking', 'Thinking - People with the thinking trait, or thinkers, heavily rely on objective information in all areas of their life. \r\nThey are critical thinkers who evaluate situations and people based on logic and facts and focus on problem-solving when confronted with personal or work challenges.\r\n', 'Perceiving', 'Perceivers approach life and a freewheeling, spontaneous way, preferring to keep their options open than make a clear plan of action. They perceive structure as limiting and seek flexibility in their lives. \r\nThey like adapting to new situations and feel frustrated by the daily grind of routines.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(10, 'ESFP', 'ESFPs have an Extraverted, Observant, Feeling and Perceiving personality, and are commonly seen as Entertainers. Born to be in front of others and to capture the stage, ESFPs love the spotlight. ESFPs are thoughtful explorers who love learning and sharing what they learn with others. They are lively and fun, and enjoy being the center of attention. They are warm, generous, and friendly, sympathetic and concerned for other people’s well-being.', 'Extraversion,Sensing,Feeling,Perceiving', '4-9%', 'The Performer', , 'Any activities requiring good performing or entertaining skills are very suitable for ESFPs. For example, this is possible in appropriate marketing roles. Also ESFPs often find themselves in occupations that involve direct communications with customers and audiences where such skills are useful. They can work in organizations of various sizes and industries. Social work or social counselling also a favourable to ESFPs area. ESFPs often realize their artistic abilities in media and entertainment organizations.', 'Feelings and more feelings fill the life of ESFPs and give it meaning. They are easy to communicate with, and a lot can be discussed and laughed about with ESFPs. They exhibit great warmth when talking about others, even if they sometimes tease them. When it comes to gatherings of friends and acquaintances, ESFPs are always the life of the party. That is how trusting and warm relationships start, which are especially strengthened by their sincere attentiveness to the pressing problems of their conversation parties. ESFPs’ energy and capacity for empathy inevitably engage others in the lively atmosphere they create around themselves. It is true, however, that their drive to create a festive or cheerful atmosphere can lead to displeasure among some who may find it inappropriate.', 'Extraversion', 'Extraversion includes traits such as talkative, energetic, assertive, and outgoing. Social interaction is the key here. Extraverts often take on positions of leadership; first to offer their opinion and suggestions. They are often quick to approach others, especially on the dating scene.', 'Sensing', 'Paying attention to physical reality, what I see, hear, touch, taste, and smell. I\'m concerned with what is actual, present, current, and real. I notice facts and I remember details that are important to me. I like to see the practical use of things and learn best when I see how to use what I\'m learning.', 'Feeling', 'People with the feeling trait, or feelers, are typically aware of not only their own emotions but the emotions of others around them, too. They are protective of those they value, which affects endeavors they conduct both personally and professionally.', 'Perceiving', 'Perceivers approach life and a freewheeling, spontaneous way, preferring to keep their options open than make a clear plan of action. They perceive structure as limiting and seek flexibility in their lives. They like adapting to new situations and feel frustrated by the daily grind of routines.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(11, 'ENFP', 'ENFPs have an Extraverted, Intuitive, Feeling and Perceiving personality. This personality type is highly individualistic and Champions strive toward creating their own methods, looks, actions, habits, and ideas and hate when they are forced to live inside a box. They like to be around other people and have a strong intuitive nature when it comes to themselves and others. They operate from their feelings most of the time, and they are highly perceptive and thoughtful.', 'Extraversion,iNtuition,Feeling,Perceiving', '6-8%', 'The Champion', , 'ENFPs are effective in occupations involving a lot of intellectual work that is focused on humanities and social science and requiring creativity. For example they make good life coaches, social workers, psychologists, addiction rehab counsellors, and other mental and community care staff. They are also successful in teaching humanities and social science – related subjects. As well they succeed as journalists and in various occupations requiring good communication skills.', 'The wish to understand others and to help them is what fills an ENFP’s life with meaning and serves as their main motivation. This is how they perceive the world and the people around them - their emotions and actions. One might say that orientation of an ENFP’s feelings is primarily defined by the following factors: opportunity to offer assistance vs. lack thereof, and acceptance vs. rejection. They feel their best when they have the opportunity to help and they are accepted by others and their worst when they encounter withdrawal and rejection.', 'Extraversion', 'Extraversion includes traits such as talkative, energetic, assertive, and outgoing. Social interaction is the key here. Extraverts often take on positions of leadership; first to offer their opinion and suggestions. They are often quick to approach others, especially on the dating scene.', 'Intuituion', 'Paying the most attention to impressions or the meaning and patterns of the information I get. I would rather learn by thinking a problem through than by hands-on experience. I\'m interested in new things and what might be possible, so that I think more about the future than the past.', 'Feeling', 'People with the feeling trait, or feelers, are typically aware of not only their own emotions but the emotions of others around them, too. They are protective of those they value, which affects endeavors they conduct both personally and professionally.', 'Perceiving', 'Perceivers approach life and a freewheeling, spontaneous way, preferring to keep their options open than make a clear plan of action. They perceive structure as limiting and seek flexibility in their lives. They like adapting to new situations and feel frustrated by the daily grind of routines.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(12, 'ENTP', 'Those with the ENTP personality are some of the rarest in the world, which is completely understandable. Although they are extroverts, they don’t enjoy small talk and may not thrive in many social situations, especially those that involve people who are too different from the ENTP. ENTPs are intelligent and knowledgeable need to be constantly mentally stimulated. They are logical, rational, and objective in their approach to information and arguments.', 'Extraversion,iNtuition,Thinking,Perceiving', '2-5%', 'The Visionary', , 'Generally, ENTPs build successful careers in areas requiring intensive intellectual efforts, calling for creative approach and presenting intellectual challenge. Because of the characteristics mentioned above, ENTPs are often found in research, development and analytical departments. ENTPs often make a very successful career in academia thanks to their strong and versatile way of thinking along with great erudition.', 'In the process of communication, ENTPs try to bring to light the logical connections between phenomena and events and provide explanations for them. They find great satisfaction in having their inferences recognized by the other party.\r\n\r\nENTPs are interesting and easy to talk to, although some of their conversation partners may be exhausted by the somewhat adversarial form their communication takes. As a rule, ENTPs feel at ease conversing in a group, while they actively assert their independent view on the topic of discussion. For them, friendly conversations usually work out with people of equal intellect.', 'Extraversion', 'Extraversion includes traits such as talkative, energetic, assertive, and outgoing. Social interaction is the key here. Extraverts often take on positions of leadership; first to offer their opinion and suggestions. They are often quick to approach others, especially on the dating scene.', 'Intuituion', 'Paying the most attention to impressions or the meaning and patterns of the information I get. I would rather learn by thinking a problem through than by hands-on experience. I\'m interested in new things and what might be possible, so that I think more about the future than the past.', 'Thinking', 'People with the thinking trait, or thinkers, heavily rely on objective information in all areas of their life. \r\nThey are critical thinkers who evaluate situations and people based on logic and facts and focus on problem-solving when confronted with personal or work challenges.', 'Perceiving', 'Perceivers approach life and a freewheeling, spontaneous way, preferring to keep their options open than make a clear plan of action. They perceive structure as limiting and seek flexibility in their lives. They like adapting to new situations and feel frustrated by the daily grind of routines.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(13, 'ESTJ', 'ESTJs are organized, honest, dedicated, dignified, traditional, and are great believers of doing what they believe is right and socially acceptable. Though the paths towards “good” and “right” are difficult, they are glad to take their place as the leaders of the pack. They are the epitome of good citizenry. People look to ESTJs for guidance and counsel, and ESTJs are always happy that they are approached for help.', 'Extraversion,Sensing,Thinking,Judging', '8-12%', 'The Supervisor', , 'ESTJs often find themselves in occupations that require thorough analysis, practical planning and organizational skills, process control and responsibility. ESTJs make good mid- and high-rank managers and executives. They succeed as military and police workers, politicians, engineers and entrepreneurs. They are found in technology companies among those who deal with practical aspects of technology (e.g. implementation specialists).', 'In communication ESTJs are open but often demanding. They expect others to fulfill what was discussed and agreed upon, in due time and in the proper manner. ESTJs most often embody this attitude just as well toward themselves.\r\n\r\nESTJs are usually not comfortable with situations requiring especially good people skills, e.g. being particularly delicate or patient. Their open and direct proclamation of their principles and intentions may sometimes hurt the feelings of the more feeling types (F) or provoke strong resistance on part of other leadership-oriented people who may have a different opinion.', 'Extraversion', 'Extraversion includes traits such as talkative, energetic, assertive, and outgoing. Social interaction is the key here. Extraverts often take on positions of leadership; first to offer their opinion and suggestions. They are often quick to approach others, especially on the dating scene.', 'Sensing', 'Paying attention to physical reality, what I see, hear, touch, taste, and smell. I\'m concerned with what is actual, present, current, and real. I notice facts and I remember details that are important to me. I like to see the practical use of things and learn best when I see how to use what I\'m learning.', 'Thinking', 'People with the thinking trait, or thinkers, heavily rely on objective information in all areas of their life. \r\nThey are critical thinkers who evaluate situations and people based on logic and facts and focus on problem-solving when confronted with personal or work challenges.', 'Judging', 'Judging means you seek closure from the outer world through order, planning, and organization. When possible, you prefer for things to be settled and crossed off your list. Judgers may want to find work that allows them to set goals, be organized, and make decisions.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(14, 'ESFJ', 'ESFJs are the stereotypical extroverts. They are social butterflies, and their need to interact with others and make people happy usually ends up making them popular. The ESFJ usually tends to be the cheerleader or sports hero in high school and college. Later on in life, they continue to revel in the spotlight, and are primarily focused on organizing social events for their families, friends and communities. ESFJ is a common personality type and one that is liked by many people.', 'Extraversion,Sensing,Feeling,Judging', '9-13%', 'The Provider ', , 'ESFJs often find themselves in occupations that involve either a lot of direct interaction with other people (e.g. clients, other staff members) or involve responsibility for critical tasks (e.g. require thorough attention or may have serious consequences), or both. Very often ESFJs realize their potential in health care and various community care organizations. Other favored areas of occupation include social work, service-oriented professions as well as teaching (often at elementary schools).', 'In communication, ESFJs are practical, concrete, and at the same time supportive and responsive toward the needs of the other party. They are certain of their reasoning and they want others to share it. ESFJs keep to a soft, but assertive communication style. They are clear sticklers to following communication standards and rules accepted in their circle or community.\r\n\r\nESFJs have a fairly wide social circle including friends and acquaintances, e.g. people they have met during their travels, or at entertainment events. Many people like to converse with ESFJs about various issues of a practical or day-to-day nature, as well as about their impressions and experiences.', 'Extraversion', 'Extraversion includes traits such as talkative, energetic, assertive, and outgoing. Social interaction is the key here. Extraverts often take on positions of leadership; first to offer their opinion and suggestions. \r\nThey are often quick to approach others, especially on the dating scene.', 'Sensing', 'Paying attention to physical reality, what I see, hear, touch, taste, and smell. I\'m concerned with what is actual, present, current, and real. I notice facts and I remember details that are important to me. \r\nI like to see the practical use of things and learn best when I see how to use what I\'m learning.', 'Feeling', 'People with the feeling trait, or feelers, are typically aware of not only their own emotions but the emotions of others around them, too. \r\nThey are protective of those they value, which affects endeavors they conduct both personally and professionally.', 'Judging', 'Judging means you seek closure from the outer world through order, planning, and organization. When possible, you prefer for things to be settled and crossed off your list. Judgers may want to find work that allows them to set goals, be organized, and make decisions.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(15, 'ENFJ', 'ENFJs are people-focused individuals. They are extroverted, idealistic, charismatic, outspoken, highly principled and ethical, and usually know how to connect with others no matter their background or personality. Mainly relying on intuition and feelings, they tend to live in their imagination rather than in the real world. Instead of focusing on living in the “now” and what is currently happening, ENFJs tend to concentrate on the abstract and what could possibly happen in the future.', 'Extraversion,iNtuition,Feeling,Judging', '2-5%', 'The Giver', , 'ENFJs often find themselves in occupations that require good interpersonal skills to establish productive collaboration as well as to establish or maintain effective work process. ENFJs one of the most “universal” personality types and they build successful careers in a broad range of organizations and occupations. There are many ENFJs found among mid- and high-rank management roles. Sales, various social services, counseling, teaching, healthcare, community care as well as legal and paralegal services are just some of the examples of favourable occupations for ENFJs.', 'ENFJs are gifted with prominent communicative abilities and capable of persuading others to accept their way of thinking or their endeavor, and earning other people\'s trust. ENFJs gladly help others, but may become quite unhappy with those who refuse to accept the kind of help that seems the most appropriate to the ENFJ in question. They feel at ease while communicating with many people at once. Many ENFJs are very energetic and always ready to join a conversation. Often they are the ones who initiate in-depth discussions, of various topics. In communication ENFJs come across as confident, supportive, possessing the gift of gab, individuals. Sometimes they may be quite expressive about their feelings.', 'Extraversion', 'Extraversion includes traits such as talkative, energetic, assertive, and outgoing. Social interaction is the key here. Extraverts often take on positions of leadership; first to offer their opinion and suggestions. They are often quick to approach others, especially on the dating scene.', 'Intuituion', 'Paying the most attention to impressions or the meaning and patterns of the information I get. I would rather learn by thinking a problem through than by hands-on experience. I\'m interested in new things and what might be possible, so that I think more about the future than the past.', 'Feeling', 'People with the feeling trait, or feelers, are typically aware of not only their own emotions but the emotions of others around them, too. \r\nThey are protective of those they value, which affects endeavors they conduct both personally and professionally.', 'Judging', 'Judging means you seek closure from the outer world through order, planning, and organization. When possible, you prefer for things to be settled and crossed off your list. Judgers may want to find work that allows them to set goals, be organized, and make decisions.');
INSERT INTO `guidance_types` (`tid`, `type`, `description`, `meaning`, `percentage`, `profile`, `image`, `career`, `comm`, `type_name1`, `type_1`, `type_name2`, `type_2`, `type_name3`, `type_3`, `type_name4`, `type_4`) VALUES
(16, 'ENTJ', 'An ENTJ’s primary mode of living focuses on external aspects and all things are dealt with rationally and logically. Their secondary mode of operation is internal, where intuition and reasoning take effect.  They often see challenges and obstacles as great opportunities to push themselves. They seem to have a natural gift for leadership, making decisions, and considering options and ideas quickly yet carefully. They are “take charge” people who do not like to sit still.', 'Extraversion,iNtuition,Thinking,Feeling', '2-5%', 'The Commander ', , 'ENTJs often find themselves in occupations that require good analytical and planning skills. ENTJs build successful careers in the areas requiring considerable organizational skills and intellectual efforts, presenting a challenge, and calling for creativity. They are greatly represented in technological and management consulting companies among engineers and developers, and among high- and mid-rank managers. They are also able to realize their potential in start-ups where they often fulfill management positions or take responsibility for the whole project.', 'ENTJs respect and maintain the manners and order accepted in their circle. They may often come across as demanding, but as a rule, not when it comes to minor issues. ENTJs are ready to share their opinion with those around them and to find out theirs. At the same time, they often strive to ensure that their opinion be the one recognized as the right one. Their objective, business-like, confident and at times bossy conversation style can be upsetting to people of a more feeling type or result in counteraction on the part of others who are also disposed toward leadership.', 'Extraversion', 'Extraversion includes traits such as talkative, energetic, assertive, and outgoing. Social interaction is the key here. Extraverts often take on positions of leadership; first to offer their opinion and suggestions. They are often quick to approach others, especially on the dating scene.', 'Intuituion', 'Paying the most attention to impressions or the meaning and patterns of the information I get. I would rather learn by thinking a problem through than by hands-on experience. I\'m interested in new things and what might be possible, so that I think more about the future than the past.', 'Thinking', 'People with the thinking trait, or thinkers, heavily rely on objective information in all areas of their life. \r\nThey are critical thinkers who evaluate situations and people based on logic and facts and focus on problem-solving when confronted with personal or work challenges.', 'Judging', 'Judging means you seek closure from the outer world through order, planning, and organization. When possible, you prefer for things to be settled and crossed off your list. Judgers may want to find work that allows them to set goals, be organized, and make decisions.');

