DELIMITER $$
CREATE TRIGGER `delete_sync_teacher_info` AFTER DELETE ON `hr_employee` FOR EACH ROW BEGIN
    DELETE FROM mis_teacher_account WHERE `id` = OLD.id;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `sync_teacher_info` AFTER INSERT ON `hr_employee` FOR EACH ROW BEGIN
    IF NEW.designation = 'teacher' THEN
        INSERT INTO mis_teacher_account (`id`, `user`, `pass`, `f_name`, `l_name`, `email`, `status`, `code`, `department`, `designation`, `role`, `gender`, `blood_group`, `nid`, `cp_number`, `date_of_birth`, `date_of_joining`, `date_of_leaving`, `rate_per_hour`)
        VALUES (NEW.id, CONCAT(NEW.f_name,NEW.l_name,'@bcp.edu.com'), CONCAT('#', CONCAT(UPPER(SUBSTR(NEW.l_name, 1, 1)), LOWER(SUBSTR(NEW.l_name, 2, 1))), '2023s'), NEW.f_name, NEW.l_name, NEW.email, NEW.status, NEW.code, NEW.department, NEW.designation, NEW.role, NEW.gender, NEW.blood_group, NEW.nid, NEW.cp_number, NEW.date_of_birth, NEW.date_of_joining, NEW.date_of_leaving, NEW.rate_per_hour);
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_sync_teacher_info` AFTER UPDATE ON `hr_employee` FOR EACH ROW BEGIN
    IF NEW.designation = 'teacher' THEN
        UPDATE mis_teacher_account SET `id` = NEW.id, `user` = CONCAT(NEW.f_name,NEW.l_name,'@bcp.edu.com'), `pass` = CONCAT('#', CONCAT(UPPER(SUBSTR(NEW.l_name, 1, 1)), LOWER(SUBSTR(NEW.l_name, 2, 1))), '2023s'), `f_name` = NEW.f_name, `l_name` = NEW.l_name, `email` = NEW.email, `status` = NEW.status, `code` = NEW.code, `department` = NEW.department, `designation` = NEW.designation, `role` = NEW.role, `gender` = NEW.gender, `blood_group` = NEW.blood_group, `nid` = NEW.nid, `cp_number` = NEW.cp_number, `date_of_birth` = NEW.date_of_birth, `date_of_joining` = NEW.date_of_joining, `date_of_leaving` = NEW.date_of_leaving, `rate_per_hour` = NEW.rate_per_hour WHERE `id` = OLD.id;
    ELSE
        DELETE FROM mis_teacher_account WHERE `id` = OLD.id;
    END IF;
END
$$
DELIMITER ;

