(7, 'dep2', 'DEP: ► Student Portal Enter command:<br> \n\"sp1-4\" <br><br>\n\n<a>Select Options:</a><br><br>\n<a class=\"rep\" href=\"#\"> [sp1] No Grades </a> <br> \n<a class=\"rep\" href=\"#\"> [sp2] Update balance </a> <br> \n<a class=\"rep\" href=\"#\"> [sp3] Can\'t Login </a> <br> \n<a class=\"rep\" href=\"#\"> [sp4] Other\'s </a> <br>', 0, 0),
(8, 'dep3', 'DEP: ► MIS Enter command:<br> \n\"mis1-4\" <br><br>\n\n<a>Select Options:</a><br><br>\n<a class=\"rep\" href=\"#\"> [mis1] Wrong Payment </a> <br> \n<a class=\"rep\" href=\"#\"> [mis2] Void Payment Receipt </a> <br> \n<a class=\"rep\" href=\"#\"> [mis3] Payment Method </a> <br> \n<a class=\"rep\" href=\"#\"> [mis4] Request Document </a> <br>\n<a class=\"rep\" href=\"#\"> [mis5] Other\'s </a> <br>', 0, 0),
