(10, 'lms1', 'Good Day! BCP\'s student Thankyou for your concern. kindly visit the AA Office MV campus regarding to this concern.  \n<br><br>(Can\'t Login LMS Account)\n<br><br>The office is open from Monday to Friday 8am to 4pm. <br><br> Thankyou!', 1, 0),
(11, 'lms2', 'Good Day! BCP\'s student Thankyou for your concern. kindly visit the AA Office MV campus regarding to this concern.  \n<br><br>(No Subject) to tag your subject.\n<br><br>The office is open from Monday to Friday 8am to 4pm. <br><br> Thankyou!', 1, 0),
(12, 'lms3', 'Good Day! BCP\'s student Thankyou for your concern. kindly visit the AA Office MV campus regarding to this concern.  \n<br><br>(Wrong Subject) to un tag the subject.\n<br><br>The office is open from Monday to Friday 8am to 4pm. <br><br> Thankyou!', 1, 0),
(13, 'lms4', 'Good Day! BCP\'s student Thankyou for your concern to open or grant your examination you need to pay or down your payment for prelim, midterm, or finals.\n<br><br>Thankyou!', 1, 0),
(14, 'lms5', 'Unavailable Data', 0, 0),
(15, 'sp1', 'Good Day! BCP\'s student Thankyou for your concern. \n<br><br>First you need to ask your subject teacher for this concern to modify your grade and kindly visit the Registrar Office Main campus regarding to this concern.  \n<br><br>(No Grades)\n<br><br>The office is open from Monday to Friday 8am to 4pm. <br><br> Thankyou!', 1, 0),
(16, 'sp2', 'Good Day! BCP\'s student Thankyou for your concern. \n<br><br>To review your total balance kindly visit the BIS Office Main campus regarding to this concern.  \n<br><br>(No Grades)\n<br><br>The office is open from Monday to Friday 8am to 4pm. <br><br> Thankyou!', 1, 0),
(17, 'sp3', 'Good Day! BCP\'s student Thankyou for your concern. kindly visit the MIS Office Main campus regarding to this concern.  \n<br><br>(Can\'t Login Portal Account)\n<br><br>The office is open from Monday to Friday 8am to 4pm. <br><br> Thankyou!', 1, 0),
(18, 'sp4', 'Unavailable Data', 0, 0),
(19, 'mis1', 'Good Day! BCP\'s student Thankyou for your concern. kindly visit the MIS Office main campus regarding to this concern. \n<br><br>(Wrong Payment)\n<br><br>The office is open from Monday to Friday 8am to 4pm.\n<br><br>\nThankyou!', 1, 0),
(20, 'mis2', 'Good Day! BCP\'s student Thankyou for your concern. kindly visit the MIS Office main campus regarding to this concern. \n<br><br>(Void Payment Receipt)\n<br><br>The office is open from Monday to Friday 8am to 4pm.\n<br><br>\nThankyou!', 1, 0),
(21, 'mis3', 'Good Day! BCP\'s student Thankyou for your concern.\n<br><br>They have different method of paying your bill.<br><br>\n<a href=\"#\">1. BCP Cashier</a><br>\n<a href=\"https://play.google.com/store/apps/details?id=com.aub.hellomoney&hl=en&gl=US\" target=\"main\">2. Hello Money App</a><br>\n<a href=\"#\">3. AUB</a>\n<br><br>\nThankyou!', 1, 0),
(22, 'mis4', 'Good Day! BCP\'s student Thankyou for your concern. if you want to request a document you need to follow the steps below:\n<br><br>First Step 1: Pay for document you want to request. Example (SOA, COG, and Evaluations)\n<br><br>Second Step 2: Give the receipt in the registrar Office and wait for the one week process of your requested document. \n<br><br>The Registrar office is open from Monday to Friday 8am to 4pm.\n<br><br>\nThankyou!', 1, 0),
(23, 'mis5', 'Unavailable Data', 0, 0),
(24, 'cli1', 'Good Day! BCP\'s student Thankyou for your concern. kindly visit the Clinic Office at Main Campus or MV campus for your medical.\n<br><br>(Appoint your Medical)\n<br><br>The office is open from Monday to Friday 8am to 4pm.\n<br><br>\nThankyou!', 1, 0),
(25, 'cli2', 'Good Day! BCP\'s student Thankyou for your concern. kindly visit the Clinic Office at Main Campus or MV campus for checkup.\n<br><br>(Daily Checkup)\n<br><br>The office is open from Monday to Friday 8am to 4pm.\n<br><br>\nThankyou!', 1, 0),
(26, 'cli3', 'Good Day! BCP\'s student Thankyou for your concern. kindly visit the Clinic Office at Main Campus or MV campus for your medical status.\n<br><br>(Medical Status)\n<br><br>The office is open from Monday to Friday 8am to 4pm.\n<br><br>\nThankyou!', 0, 0),
(27, 'cli4', 'Unavailable Data', 0, 0);

