DELIMITER $$
CREATE TRIGGER `sync_stud_acc` AFTER INSERT ON `registrar_studentsection` FOR EACH ROW BEGIN
    INSERT INTO mis_stud_account (`No`, `Section_ID`, `Student_ID`, `email`, `username`, `pass`, `Lastname`, `Firstname`, `Middlename`, `Course`, `Year_Level`, `Section`, `Semester`, `Major`, `Academic_Year`, `Student_Type`, `Status`, `Register_Date`, `submitted_by`, `qr_text`)
    VALUES (NEW.No, NEW.Section_ID, NEW.Student_ID, CONCAT(NEW.Student_ID, '@bcp.edu.ph'), CONCAT('s', NEW.Student_ID), CONCAT('#', CONCAT(UPPER(SUBSTR(NEW.Lastname, 1, 1)), LOWER(SUBSTR(NEW.Lastname, 2, 1))), '8080s'), NEW.Lastname, NEW.Firstname, NEW.Middlename, NEW.Course, NEW.Year_Level, NEW.Section, NEW.Semester, NEW.Major, NEW.Academic_Year, NEW.Student_Type, NEW.Status, NEW.Register_Date, NEW.submitted_by, NEW.qr_text);
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_sync_stud_acc` AFTER UPDATE ON `registrar_studentsection` FOR EACH ROW BEGIN
    UPDATE mis_stud_account
    SET Section_ID = NEW.Section_ID,
        Student_ID = NEW.Student_ID,
        email = CONCAT(NEW.Student_ID, '@bcp.edu.ph'),
        username = CONCAT('s', NEW.Student_ID),
        pass = CONCAT('#', CONCAT(UPPER(SUBSTR(NEW.Lastname, 1, 1)), LOWER(SUBSTR(NEW.Lastname, 2, 1))), '8080s'),
        Lastname = NEW.Lastname,
        Firstname = NEW.Firstname,
        Middlename = NEW.Middlename,
        Course = NEW.Course,
        Year_Level = NEW.Year_Level,
        Section = NEW.Section,
        Semester = NEW.Semester,
        Major = NEW.Major,
        Academic_Year = NEW.Academic_Year,
        Student_Type = NEW.Student_Type,
        Status = NEW.Status,
        Register_Date = NEW.Register_Date,
        submitted_by = NEW.submitted_by,
        qr_text = NEW.qr_text
    WHERE No = OLD.No;
END
$$
DELIMITER ;

